import React, { Component } from 'react';
import Head from './Head';
import Content from './Content';
import deneme from './Deneme'
class App extends Component {
	render() {
		return (
			<div className="container ">
				<Head />
				<Content />
				<Deneme/>

			</div>
		);
	}
}

export default App;
